export const rightToc = [{
  value: 'Python Version',
  id: 'python-version',
  children: []
}, {
  value: 'Package Installation',
  id: 'package-installation',
  children: [{
    value: 'Using <code> gunicorn</code>',
    id: 'using--gunicorn',
    children: []
  }, {
    value: 'Using Python run command',
    id: 'using-python-run-command',
    children: []
  }]
}];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`In this section we explain the required software/packages for running the app`}</p>
    <h2 {...{
      "id": "python-version"
    }}>{`Python Version`}</h2>
    <p>{`To run this app `}<code>{` python 3.x`}</code>{`, is required.  `}</p>
    <h2 {...{
      "id": "package-installation"
    }}>{`Package Installation`}</h2>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Make sure `}<code>{`pip`}</code>{` package manager is installed to run through this section`}</p></div></div>
    <p>{`Many packages are used in creating this app. To easily download all relevant packages. Please run `}<code>{`pip install -r requirements.txt`}</code>{` in the `}<code>{` dashboard`}</code>{` folder`}</p>
    <h1 {...{
      "id": "running-the-app"
    }}>{`Running the app`}</h1>
    <p>{`To run the app, you can decide to run one of the following two commands`}</p>
    <h3 {...{
      "id": "using--gunicorn"
    }}>{`Using `}<code>{` gunicorn`}</code></h3>
    <p>{`In deploying the app into cloud or running or on WSGI gunicorn command is recommended. For example,`}</p>
    <code>gunicorn --workers=16 --threads=4 --worker-class=gthread app:app.server -b 0.0.0.0:8000 --timeout 250 </code>
will run the app on 16 workers with 4 threads on localhost:8000.
    <h3 {...{
      "id": "using-python-run-command"
    }}>{`Using Python run command`}</h3>
    <p>{`To run this withouth WSGI support and running on development server, simply run `}<code>{`python app.py`}</code>{` in the `}<code>{`dashboard_v2`}</code>{` directory`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
